import React from "react";
import "./slidebar.scss";
const Slidebar = () => {
  return (
    <div className="sliderbar">
      <div className="slider">
        <div className="container">
          <div className="item">
            <div className="left">.leftContainer{}</div>
            <div className="right"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Slidebar;
